USE Filme;
set statistics time on;
CREATE TABLE Pessoa (
  ID INTEGER PRIMARY KEY, 
  nome VARCHAR(100),
  nascEm int
) AS NODE;

CREATE TABLE Filme
(
    ID INTEGER PRIMARY KEY,
    titulo VARCHAR(100),
    genero VARCHAR(100),
    ano int,
    duracao int
) AS NODE;

CREATE TABLE dirigiu as EDGE;
CREATE TABLE produziu as EDGE;
CREATE TABLE escreveu as EDGE;
CREATE TABLE atuouEm as EDGE;

